column8:
弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。FJクルーザー、L/C120プラド、215SURF等の<br>
1GR-FE型全車に取り付け可能な、<br>
5ジゲン製の点火系ブーストアップチューニングの決定版です。<br>
ECON内部にはDC/DCコンバーターが内臓されており、<br>
12V以下の電圧でも常に16Vに変換されIGコイルに供給される。<br>
これにより1次電圧がノーマルの130％まで上昇し<br>
安定したスパークが得られる。<br>
製品内部に点火コイル保護機能を持たせることで、<br>
点火コイルに影響を与えない安心設計で作られています。<br>
最新型ダイレクトイグニッション車の<br>
点火系チューニングはECONで決まりです！！<br>
ECON本体と専用ハーネスのセットです。<br>
写真のハーネスは1GR-FE用ではありません。<br>
ご注文後にとりよせますので、数日間の納期が必要です。<!-- ここから リア受 -->
